import React from "react";
import Layout from "../components/layout";
import Head from "next/head";

const About = () => {
  return (
    <Layout>
      <Head>
        <title>About-page</title>
      </Head>
      <h1>About page </h1>
    </Layout>
  );
};

export default About;
